import React from "react";
import Card from "react-bootstrap/Card";
import Col from "react-bootstrap/Col";
import "./Book.scss";

const Book = (props) => {
    return (
        <Col lg="3">
            <Card className="card mt-5">
                <Card.Img className="card__image" variant="top" src="https://mymagic-central.s3.amazonaws.com/uploads/organization/thumbnail/b3c6e2018d5590331561c27f3050ce5d3998c2a3.adaptiveResize.320x320.jpg" />
                <Card.Body>
                    <Card.Title className="card__title mb-2">{props.book.title}</Card.Title>
                    <Card.Subtitle className="card__author mb-3">{props.book.author}</Card.Subtitle>
                    <Card.Text className="card__description">{props.book.description}</Card.Text>
                </Card.Body>
            </Card>
        </Col>
    )
}

export default Book;
